import './header.css'

export default function Header() {
    return (
        <div className="header">
            <div className="headerTitles">
                <span className="headerTitleSm">React * Node</span>
                <span className="headerTitleLg">Blog</span>
            </div>
            <img className="headerImg" src="https://scontent-bom1-2.xx.fbcdn.net/v/t1.6435-9/69777455_185642395803695_3517038655862472704_n.jpg?_nc_cat=111&ccb=1-3&_nc_sid=e3f864&_nc_ohc=X0NTb5B3dqwAX_Qf2Zk&_nc_ht=scontent-bom1-2.xx&oh=ad391e7c15b84275fbc683616d25b2b8&oe=60D5A7BB" alt="see if"/>
        </div>
    )
}
